INSERT INTO `wp_options` VALUES (1073,'wpml_global_notices_config','<wpml-config>\n    <notices>\n        <notice type=\"info\" dismissible=\"1\" id=\"compdev-560-learndash\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-560/ -->\n            <conditions>\n                <plugin>LearnDash LMS</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content><![CDATA[\n<p style=\"margin-top:6px;\">\nRemember to manually connect your LearnDash components after translating them. <a target=\"_blank\" href=\"https://wpml.org/documentation/plugins-compatibility/how-to-create-multilingual-online-courses-websites-using-learndash-and-wpml/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">Learn how to do this</a>.\n</p>\n]]></content>\n        </notice>\n        <notice id=\"compdev-762-wp-residence\" dismissible=\"1\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-762/ -->\n            <conditions>\n                <theme>WpResidence</theme>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content><![CDATA[\n<p style=\"margin-top:6px;\">\nTo translate custom fields created with WP Residence, set their translation preferences in <a target=\"_blank\" href=\"/wp-admin/admin.php?page=tm%2Fmenu%2Fsettings&sm=mcsetup#ml-content-setup-sec-cf\">WPML → Settings</a>.\n</p>\n        ]]></content>\n        </notice>\n        <notice id=\"compdev-765-jetengine\" dismissible=\"1\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-765/ -->\n            <conditions>\n                <plugin>JetEngine</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content>\n                <![CDATA[\n<p style=\"margin-top:6px;\">\nTo translate custom post types, custom fields, and taxonomies created with JetEngine, you first need to make them translatable. <a target=\"_blank\" href=\"https://wpml.org/documentation/plugins-compatibility/how-to-translate-jetengine-with-wpml/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">Learn how to do this</a>.\n</p>\n        ]]>\n            </content>\n        </notice>\n        <notice id=\"compdev-764-events-manager\" dismissible=\"1\" type=\"warning\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-764/ -->\n            <conditions>\n                <plugin>Events Manager</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n                <screenId>edit-event</screenId>\n            </locations>\n            <content>\n                <![CDATA[\n<p style=\"margin-top:6px;\">\nEvents Manager is no longer compatible with WPML, so you won’t be able to translate your events. <a target=\"_blank\" href=\"https://wpml.org/plugin-functionality/calendar/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">Here’s a list of other recommended plugins</a>.\n</p>\n        ]]>\n            </content>\n        </notice>\n        <notice id=\"compdev-760-formidable\" dismissible=\"1\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-760/ -->\n            <conditions>\n                <plugin>Formidable Forms</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content>\n                <![CDATA[\n<p style=\"margin-top:6px;\">\nTo translate Formidable Forms with WPML, install the WP Multilingual add-on from Formidable Forms. Then, use the Formidable editor to manually translate your forms. <a target=\"_blank\" href=\"https://wpml.org/documentation/plugins-compatibility/how-to-translate-formidable-forms-with-wpml/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">Learn more</a>\n</p>\n        ]]>\n            </content>\n        </notice>\n        <notice id=\"compdev-778-oxygen-builder\" dismissible=\"1\" type=\"warning\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-778 -->\n            <conditions>\n                <plugin>Oxygen</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content>\n                <![CDATA[\n<p style=\"margin-top:6px;\">\nOxygen Builder is not compatible with WPML. Here’s a <a target=\"_blank\" href=\"https://wpml.org/plugin-functionality/page-builder/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">list of recommended page builders for multilingual sites</a>.\n</p>\n        ]]>\n            </content>\n        </notice>\n        <notice id=\"compdev-777-breakdance\" dismissible=\"1\" type=\"warning\">\n            <!-- https://onthegosystems.myjetbrains.com/youtrack/issue/compdev-777 -->\n            <conditions>\n                <plugin>Breakdance</plugin>\n            </conditions>\n            <locations>\n                <screenId>toplevel_page_tm/menu/main</screenId>\n            </locations>\n            <content>\n                <![CDATA[\n<p style=\"margin-top:6px;\">\nBreakdance is not compatible with WPML. Here’s a <a target=\"_blank\" href=\"https://wpml.org/plugin-functionality/page-builder/?utm_source=plugin&utm_medium=gui&utm_campaign=core\">list of recommended page builders for multilingual sites</a>.\n</p>\n        ]]>\n            </content>\n        </notice>\n    </notices>\n</wpml-config>\n','off');
